[{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"Modules = [FamaMacBeth]","category":"page"},{"location":"api/#FamaMacBeth.FMBModel","page":"API","title":"FamaMacBeth.FMBModel","text":"FMBModel(X,y,g,resp::FMBResp) <: StatsBase.RegressionModel\n\n\n\n\n\n","category":"type"},{"location":"api/#FamaMacBeth.FMBModel-Tuple{Any, Any, Any}","page":"API","title":"FamaMacBeth.FMBModel","text":"FMBModel(X,y,g) -> FMBModel()\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.adjr2-Tuple{FamaMacBeth.FMBModel}","page":"API","title":"FamaMacBeth.adjr2","text":"adjr2(m::FMBModel) -> Float64\n\nThe adjusted R2.\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.fit-Tuple{FamaMacBeth.FMBModel}","page":"API","title":"FamaMacBeth.fit","text":"fit(m::FMBModel) -> FMBModel()\n\nRuns a Fama-MacBeth (1973) panel regression by first conducting OLS of y on X per group indicated by g, and subsequently computes the mean and standard error using the resulting coefficients. An intercept is not added to X.\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.fmb-Tuple{Array, Any, Any}","page":"API","title":"FamaMacBeth.fmb","text":"fmb(X, y, g) -> FMBModel()\n\nShort-hand for fit(FMBModel(X,y,g))\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.group-Tuple{FamaMacBeth.FMBResp}","page":"API","title":"FamaMacBeth.group","text":"group(m::FMBResp)\ngroup(m::FMBModel)\n\nReturns the group labels used.\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.nobs-Tuple{FamaMacBeth.FMBModel}","page":"API","title":"FamaMacBeth.nobs","text":"nobs(m::FMBModel) -> Vector{Int}\n\nReturns the number of observations, per group as identified by g. See also group(m::FMBResp).\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.predict-Tuple{FamaMacBeth.FMBModel, Any}","page":"API","title":"FamaMacBeth.predict","text":"predict(m::FMBModel) -> Vector\npredict(m::FMBModel, X) -> Vector\n\nPredicts the outcome using the estimated coefficients and provided independent variables. If independent variables are not provided, uses those from the model.\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.r2-Tuple{FamaMacBeth.FMBModel}","page":"API","title":"FamaMacBeth.r2","text":"r2(m::FMBModel) -> Float64\n\nThe un-adjusted R2.\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.residuals-Tuple{FamaMacBeth.FMBModel}","page":"API","title":"FamaMacBeth.residuals","text":"residuals(m::FMBModel) -> Vector\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.tstat-Tuple{FamaMacBeth.FMBResp}","page":"API","title":"FamaMacBeth.tstat","text":"tstat(m::FMBModel) -> Vector\ntstat(m::FMBModel) -> Vector\n\nThe t-statistic per coefficient whether the coefficient equals zero or not.\n\n\n\n\n\n","category":"method"},{"location":"api/#FamaMacBeth.vcov-Tuple{FamaMacBeth.FMBResp}","page":"API","title":"FamaMacBeth.vcov","text":"vcov(m::FMBResp) -> Matrix\nvcov(m::FMBModel) -> Matrix\n\nVariance-covariance matrix of the estimated coefficients.\n\n\n\n\n\n","category":"method"},{"location":"api/#StatsBase.coef-Tuple{FamaMacBeth.FMBResp}","page":"API","title":"StatsBase.coef","text":"coef(m::FMBResp) -> Vector\ncoef(m::FMBModel) -> Vector\n\nThe estimated coefficients.\n\n\n\n\n\n","category":"method"},{"location":"api/#StatsBase.stderror-Tuple{FamaMacBeth.FMBResp}","page":"API","title":"StatsBase.stderror","text":"stderror(m::FMBResp) -> Vector\nstderror(m::FMBModel) -> Vector\n\nThe standard error around the estimated coefficients.\n\n\n\n\n\n","category":"method"},{"location":"#FamaMacBeth-documentation","page":"FamaMacBeth documentation","title":"FamaMacBeth documentation","text":"","category":"section"},{"location":"","page":"FamaMacBeth documentation","title":"FamaMacBeth documentation","text":"FamaMacBeth.jl is a Julia package that provides a simple implementation of Fama MacBeth, verified against the paper Petersen (2009).","category":"page"},{"location":"","page":"FamaMacBeth documentation","title":"FamaMacBeth documentation","text":"Pages = [\"api.md\"]\nDepth = 2","category":"page"}]
